    <meta name="viewport" content="width=device-width, initial-scale=1">

    <style>
        body {
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            transition: background-color 0.3s ease, color 0.3s ease;
            background-size: cover;
            background-repeat: no-repeat;
            background-position: center;
            color: white; 
            font-family: Arial, sans-serif;
        }

        #clock {
            background-color: rgba(0, 0, 0, 0.7);
            padding: 10px 20px;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.3);
            position: absolute;
            top: 50px;
            left: 70px; 
            font-size: 3rem;
        }

        #uptime {
            position: absolute;
            bottom: 20px; 
            left: 50%; 
            transform: translateX(-50%);
            font-size: 1.2rem;
        }

        #social-icons {
            position: fixed;
            bottom: 20px;
            right: 20px;
            display: flex;
            flex-direction: column;
            gap: 10px;
        }

        #social-icons img {
            width: 30px;
            height: 30px;
        }

        button {
            padding: 10px 20px;
            background: linear-gradient(45deg, #FFBE80, #FF9A8B);
            border: none;
            color: white;
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 16px;
            margin-top: 20px;
            cursor: pointer;
            border-radius: 5px;
            max-width: 200px; 
            width: 100%; 
            box-sizing: border-box; 
        }

        button:hover {
            background: linear-gradient(45deg, #FF9A8B, #FFBE80);
        }

    </style>
</head>
